nofollow" target="_blank">Ver facebook</a></span></span><span><strong>Email: </strong><span><a href="mailto:reservas@hotelcarvallo.com.ec?Subject=Información"> Enviar mail</a></span></span></div></div></div><article class="Section-description"><h3 class="Section-descriptionTitle"><strong>Descripción</strong></h3><p>Hotel carvallo con una típica construcción cuencana, que se encuentra en el corazón de Cuenca y a unos cuantos pasos del parque Calderón.</p>
<p>Ven y hospédate en este bonito hotel que esta a unos cuantos pasos de las principales iglesias de la ciudad, nuestra ética de buen trato a nuestros clientes hace que te sienta cómodo y a gusto como si estuvieras en casa.</p>
